import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'
import { get } from '../../../../utils/axios'
import Tr from './Tr'
import './index.css'

export default class Record extends Component {
    state={
        arr:[]
    }
    getall = async()=>{
        try{
            let res = await get('/api/getall')
            this.setState({arr:res.data.data})
        }catch(err){
            console.log("error",err)
     }
    }
    componentDidMount(){
        this.getall()
    }
    render() {
        return (
            <div>
                <div className="showlink">
                    <NavLink to="">列表显示</NavLink>
                    <NavLink>图表显示</NavLink>
                </div>
            <div id="table">
                    <tr>
                        <td><input type="checkbox" /></td>
                        <td>编号</td>
                        <td>日期</td>
                        <td>失物</td>
                        <td>姓名</td>
                        <td>学号</td>
                        <td>状态</td>
                        <td>领取地址</td>
                        <td>操作</td>
                    </tr>
                    {this.state.arr.map((item,index)=>{
                        return <Tr {...item}></Tr>
                    })}
            </div>
            </div>
        )
    }
}
